import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import calculators from "./data/calculators"; // Import data file
import WhatIDo from "./what_I_do"; // Importing WhatIDo component
import "./App.css";

function App() {
  return (
    <Router>
      <div className="navbar">
        <h1>My Portfolio</h1>
        <ul className="content">
          <ul><Link to="/">Home</Link></ul>
          <ul><Link to="/whatido">What I Do</Link></ul>
          <ul><Link to="/projects">Projects</Link></ul>
          <ul><Link to="/about">About Me</Link></ul>
        </ul>
      </div>

      { <div className="container">
        {calculators.map((calc, index) => (
          <div className="image-grid" key={index}>
            <img src={calc.img} alt={calc.label} />
              <div className="middle">
                <h3>{calc.label}</h3>
                <Link to={calc.link}>
                  <button>Launch Calculator</button>
                </Link>
              <p className="caption">
                { calc.label} Calculator
              </p>
          </div>
        </div>
      ))}
    </div> }


      {/* Routes */}
      <Routes>
        <Route path="/whatido" element={<WhatIDo />} />
        {calculators.map((calc, index) => (
          <Route key={index} path={calc.link} element={<h1>{calc.label} Page</h1>} />
        ))}
      </Routes>
    </Router>
  );
}

export default App;
